# 2.1 Human metabolic experiments 

We estimated the metabolic cost of producing time-varying forces from human experiments where the subjects tracked piecewise sinusoidal forces using their right leg while sitting in a comfortable posture (Figure 1A). We measured volumetric rates of oxygen and carbon dioxide in the respiratory gases (MGC Diagnostics Corporation Ultima CardiO2 metabolic cart) and estimated the metabolic cost $\dot{E}_{\text {trial }}$ using the following empirical equation [13] relating the measured quantities: $\dot{E}=16.58 \mathrm{~V}_{\mathrm{CO}_{2}}+4.51 \mathrm{~V}_{\mathrm{O}_{2}} \mathrm{~W} / \mathrm{kg}$. Each trial lasted 5 minutes, allowing us to estimate the steady metabolic cost more reliably. We measure the forces exerted by the participants perpendicular to the platform (vernier force platforms), which were streamed real-time to a computer screen (lab view DAQ NI 6008) to provide a visual feedback to the subject of the applied force as well as the desired force. The fundamental period $F(t)$ of the piecewise sinusoidal desired force was given by the following equation:

$$
\begin{aligned}
& F(t)=F_{\text {mean }}+F_{\text {amp }} \cdot \sin \left(\frac{2 \pi t}{t_{1}}\right) \text { for } 0 \leq t<\frac{t_{1}}{2} \text { and } \\
& F(t)=F_{\text {mean }}+F_{\text {amp }} \cdot \sin \left(\frac{2 \pi\left(t-t_{1} / 2\right)}{t_{2}}\right) \text { for } \frac{t_{1}}{2} \leq t<\frac{t_{1}+t_{2}}{2}
\end{aligned}
$$

and subsequent periods were produced by repeating this fundamental period: $F\left(t+\left(t_{1}+t_{2}\right) / 2\right)=F(t)$. The two sinusoids composing the piecewise sinusoid combination have the same mean and amplitude, with potentially equal or different rise and fall time ( $t_{1} / 2$ and $t_{2} / 2$, Figure 1A), where $t_{1}$ and $t_{2}$ are the time periods of individual sinusoids.

All experiments were approved by the Ohio State University IRB. A total of 11 subjects (7M, 4F; height $=$ $1.67 \pm 0.18 \mathrm{~m}$; mass $74.45 \pm 27.54 \mathrm{~kg}$; age $=27 \pm 8$ years, mean $\pm 2$ s.d.) participated with informed consent. Each subject performed about 30 trials split equally across two separate day sessions, with two of them completing one session each and one of them performing a different force levels for the first session. No trial was repeated across sessions or subjects, resulting in a large diverse dataset consisting of 297 unique data points across all subjects. Having different rise and fall time periods set different increasing and decreasing slopes in the sinusoid, thereby helping us to study the differences in costs of having different increasing and decreasing force rates. Piecewise sinusoidal function parameters for each trial were chosen randomly from a list containing 16 different combinations of the two sinusoid time periods such that the total time period $t_{\text {period }}=\left(t_{1}+t_{2}\right) / 2$ is either 1 s , 1.25 s or 1.5 s . For these three time periods, the rise time parameter $t_{1} / 2$ was respectively selected from the following three sets: $\{0.125,0.25,0.375,0.5,0.625,0.75,0.875 \mathrm{~s}\},\{0.25,0.5,0.75,1 \mathrm{~s}\}$ and $\{0.25,0.5,0.75,1.0,1.25 \mathrm{~s}\}$. There were three different mean force levels $\left(F_{\text {mean }}\right): 20 \%, 35 \%, 50 \%$ of the subjects' voluntary maximum force $F_{\text {max }}$, comfortable to sustain over 30 s . The two different amplitude levels $\left(F_{\text {amp }}\right), 50 \%$ and $100 \%$ of the mean force. Trials were drawn from this set in a random sequence and performed in the random sequence. Subjects performed 15 trials in a session with breaks in between. Before each trial, we estimated the force exerted by the subjects' passive and relaxed leg on the platform. All desired and applied forces have this passive leg force subtracted, so that the subjects had to only control the active force they exert on the platform.
